import {useState} from 'react'

const Rufus = props => {
	let {players} = props

	let [position, setPosition] = useState({x:60, y: 60})

	return	<circle
			cx={position.x}
			cy={position.y}
			r='20'
			fill={'red'}
			fillOpacity={.6}
		/>

}

const Gunter = props => {
	let {players} = props

	let [position, setPosition] = useState({x:20, y: 66})

	return	<circle
			cx={position.x}
			cy={position.y}
			r='20'
			fill={'blue'}
			fillOpacity={.6}
		/>

}

export {
	Rufus,
	Gunter
}
